用者（以下称“会员”）使用本网站各项服务时，会员应当同意本协议全部内容。一旦会员勾选 “我已认真阅读并同意有缘爱用户协议”,即表示会员已阅读、了解并同意与本网站达成协议，并接受所有协议条款。<br><br>    2、会员注册条件<br>  1) 申请注册成为本网站的会员应全部满足下列条件：<br>  必须年满18周岁以上。<br>  向本网站提供本人真实、正确、最新及完整的资料；<br>  随时更新登记资料，确保其有效性；<br>  提供真实有效的电子邮箱地址<br>  征友过程中，务必保持征友帐号的唯一性。<br>  2) 若会员提供任何错误、不实或不完整的资料，或本网站有理由怀疑资料为错误、不实或不完整及违反协议的，本网站有权修改会员的注册昵称、基本资料等，或暂停或终止该会员的帐号，或暂停或终止提供本网站提供的全部或部分服务。会员购买的服务，无论是否剩余及到期，均不退还。<br><br>    3、会员帐号、密码及安全<br>  1) 在完成会员注册程序之后，会员有义务保证密码及帐号的安全。会员应对利用该密码及帐号所进行的一切活动负全部责任，包括任何经由本网站以上载、张贴、发送电子邮件或任何其它方式传送的资讯、资料、文字、软件、音乐、音讯、照片、图形、视讯、信息或其它资料，无论系公开还是私下传送，均由内容提供者承担责任。<br>  2) 会员的密码或帐号遭到未获授权的使用，或者发生其它任何安全问题时，会员应立即通知本网站。由于会员使用不当导致帐号、密码泄漏，进而导致其资料、信息泄漏的，由会员承担其不利后果，本网站不承担责任。<br><br>    4、服务说明<br>  1) 本网站通过国际互联网为会员提供网络服务，为使用网站服务，会员应自行配备进入国际互联网所必需的设备，包括计算机、数据机或其它存取装置，并自行支付登陆国际互联网所需要的费用。<br>  2) 本网站在提供网络服务时，可能会对部分网络服务收取一定的费用，在此情况下，会在相关页面上做明确的提示。如会员拒绝支付该等费用，则不能使用相关的网络服务。会员应认真阅读本协议及法律声明，如会员购买付费业务，则视为接受网站协议及声明。<br>  3) 无论是付费业务还是本网站免费提供的服务等，上述服务均有有效期，有效期结束后服务将自动终止。同时所有付费业务均不提供退费服务。<br>  4) 对于利用本网站服务进行非法活动，本网站将严肃处理，包括将其列入黑名单、将其被投诉的情形公之于众、删除会员帐号等处罚措施。<br><br>    5、普通会员基本权利<br>  普通会员基本权利是指本网站承诺除遭受不可抗力外，始终予以保证的普通会员权利：<br>  1）对于自己的个人资料享有以下权利：随时查询及阅览；随时补充或更正；随时请求删除（被网站加入准黑名单或黑名单的会员，没有提出删除个人帐户资料的权利）。<br>  2） 对于他人资料享有以下权利：男性普通会员有被女性会员查询资料的权利；女性普通会员有查看和回复其他会员站内消息的权利。<br><br>    6、VIP会员基本权利<br>  VIP会员基本权利是指本网站承诺除遭受不可抗力外，始终予以保证的VIP会员权利。<br>  VIP会员除以上普通会员享有的基本权力外，尚有如下基本权利：<br>  1）无限制发送站内消息；<br>  2）经其他会员同意获取其他会员联系方式；<br><br>    7、本网站权利<br>  本网站有随时填加、修改、删除会员所填资料（资料包括但不限于会员所上传头像、昵称、性别、居住地等）的权力，该权力可用于但不限于以下情况：<br>  1）出于网站宣传需要，网站宣传期通过行使本权力吸引更多会员加入，但于本协议中明确告知该事实情况；网站宣传主要目的在于增加会员数量，以使原会员拥有更多选择和被选择机会，以从长远角度符合会员利益；<br>  2）有任何理由怀疑会员所填资料的真实性、合法性、可靠性；<br>  3）防范会员恶意上传带有淫秽、色情、反动及其他非法图片的头像；<br>  4）防止黑客通过无限制调用会员上传照片耗用本网站服务器资源；<br>  5）其他本网站认为必要的情况。<br>  无论本网站何时以何方式行使该权力，上述5、6点会员之权利均须得以保证，特别是VIP会员第3条权利；会员对此不得提出异议。 <br><br>    8、免责条款<br>  1) 本网站不担保其提供的服务一定能满足会员的要求和期望，也不担保服务不会中断，对服务的及时性、安全性、出错发生都不作担保。<br>  2) 对于会员通过本网站提供的服务传送的内容，本网站已按照国家有关规定严格审查，但无法完全控制经由网站服务传送的内容，不保证内容的正确性、完整性或品质。因此会员在使用本网站服务时，可能会接触到令人不快、不适当或令