的个人资料，才能提供会员所要求的产品和服务；<br>  为保护本网站、会员及社会公众的权利、财产或人身安全；<br>  根据法律法规的规定，向司法机关提供；<br>  受到黑客攻击导致会员信息泄漏的；<br>  被搜索引擎在搜索结果中显示；<br>  其他本网站认为有必要的情况。<br><br>    12、信息储存和限制<br>  本网站有权制订一般措施及限制，包含但不限于网站服务将保留的电子邮件讯息、所张贴内容或其他上载内容的最长期间、每个帐号可收发讯息的最大数量及可收发的单个消息的大小。通过网站服务存储或传送之任何信息、通讯资料和其他内容，如被删除或未予储存，本网站不承担任何责任。会员同意，长时间未使用的帐号，本网站有权关闭。同时本网站有权自行决定并无论通知与否，随时变更这些一般措施及限制。<br><br>    13、结束服务<br>  1) 如会员连续6月未登陆本网站，该会员的帐号将被自动关闭，本网站同时终止提供与该帐号相对应的全部或部分服务，包括收费服务等，并不承担退费或其他责任。<br>  2) 会员若反对任何本协议的内容或对之后协议条款修改有异议，或对本网站服务不满，会员只有以下的追索权：<br>  不再使用本网站服务；<br>  通告本网站停止该会员的服务。结束会员服务后，会员使用本网站的权利马上中止。<br><br>    14、赔偿<br>  1) 由于会员通过本网站提供的服务提供、张贴或传送内容、违反本服务协议、或侵害他人任何权利因而衍生或导致任何第三人提出任何索赔或请求，会员同意赔偿本网站或其他合作伙伴的损失，包括合理的律师费和调查费用等。<br>  2) 会员在投诉其他会员有违法行为或违反本协议情形时，投诉者应承担投诉所产生的全部法律责任。如侵犯他人的合法权益，投诉人应独立承担全部法律责任。如给本网站造成损失的，投诉人应承担相应的赔偿责任。  <br><br>  15、本协议的变更和修改<br>  本网站有权随时对协议进行变更和修改。一旦发生协议条款的变动，本网站将在页面上提示修改的内容，或将最新版本的协议以邮件的形式发送给会员。会员如果不同意网站会员协议的修改，可以主动取消会员资格，如对部分服务支付了费用，可以申请将费用全额或部分退回。如果会员继续使用会员帐号，则视为会员已经接受会员协议的修改。<br>    16、不可抗力<br>  1) “不可抗力”是指本网站不能合理控制、不可预见或即使预见亦无法避免的事件，该事件妨碍、影响或延误本网站根据本协议履行其全部或部分义务。该事件包括但不限于政府行为、自然灾害、战争、黑客袭击、电脑病毒、网络故障等。不可抗力可能导致本网站暂时发生瘫痪、访问速度缓慢、存储数据丢失、存储数据失真、会员个人信息泄漏等不利后果。<br>  2) 遭受不可抗力事件时，本网站可暂行中止履行本协议下的义务直至不可抗力事件的影响消除为止，并且无需为此而承担违约责任但应尽最大努力克服该事件，减轻其负面影响。<br><br>    17、通知<br>  本网站向其会员发出的通知，将采用电子邮件或页面公告的形式。协议条款的修改或其他事项变更时，本网站将会以上述形式进行通知。<br><br>    18、法律的适用和管辖<br>  本协议的生效、履行、解释及争议的解决均适用中华人民共和国的现行法律，所发生的争议应提交相关仲裁委员会，其仲裁裁决是终局的。本协议因与中华人民共和国现行法律相抵触而导致部分条款无效的，不影响其他条款的效力。<br><br>    19、最终解释权和修改权<br>  本协议的最终解释权和修改权归本网站所有。<br><br>      20、其他条款<br>  1）本用户协议是本网站和会员双方同意后所达成的协议，具有正式的法律效力。<br>   2）本网站保留进一步修改本协议的权利。<br>";};data=a:14:{s:10:"thumbwidth";s:3:"100";s:11:"thumbheight";s:3:"100";s:13:"maxthumbwidth";s:0:"";s:14:"maxthumbheight";s:0:"";s:13:"watermarkfile";s:0:"";s:12:"watermarkpos";s:1:"4";s:6:"ftpssl";s:1:"0";s:7:"ftphost";s:0:"";s:7:"ftpport";s:0:"";s:7:"ftpuser";s:0:"";s:11:"ftppassword";s:0:"";s:7:"ftppasv";s:1:"0";s:6:"ftpdir";s:0:"";s:10:"ftptimeout";s:0:"";};mail=a:9:{s:8:"mailsend";s:1:"2";