令人厌恶的内容。在任何情况下，本网站均不为会员经由网站服务以张贴、发送电子邮件或其它方式传送的任何内容负责。但本网站有权依法停止传输任何前述内容并采取相应行动，包括但不限于暂停会员使用网站服务的全部或部分，保存有关记录，并向有关机关报告。<br>  3) 对于本网站提供的各种广告信息、链接、资讯等，本网站不保证其内容的正确性、合法性或可靠性，相关责任由广告商承担；并且，对于会员经由本网站服务与广告商进行联系或商业往来，完全属于会员和广告商之间的行为，与本网站没有任何关系。对于前述商业往来所产生的任何损害或损失，本网站不承担任何责任。<br>  4) 对于用户上传的照片、资料等，本网站已采用相关措施进行审核，但不保证其内容的正确性、合法性或可靠性，相关责任由上传上述内容的会员负责。<br>  5) 会员以自己的独立判断从事与交友相关的行为，并独立承担可能产生的不利后果和责任，本网站不承担任何法律责任。<br>  6) 本网站对所有会员自发组织的活动、自发成立的组织不负责任。<br>  7) 对于会员的投诉，本网站将认真核实，但不保证最终公之于众的投诉的真实性、合法性，对于投诉内容侵犯会员隐私权、名誉权等合法权利的，所有法律责任由投诉者承担，与本网站无关。<br><br>      9、会员应遵守以下法律法规：<br>  1) 会员同意遵守《中华人民共和国合同法》、《中华人民共和国著作权法》、《全国人民代表大会常务委员会关于维护互联网安全的决定》、《中华人民共和国保守国家秘密法》、《中华人民共和国电信条例》、《中华人民共和国计算机信息系统安全保护条例》、《中华人民共和国计算机信息网络国际联网管理暂行规定》及其实施办法、《计算机信息系统国际联网保密管理规定》、《互联网信息服务管理办法》、《计算机信息网络国际联网安全保护管理办法》、《互联网电子公告服务管理规定》等相关中国法律法规的任何及所有的规定。<br>  2) 在任何情况下，如果本网站有理由认为会员的任何行为，包括但不限于会员的任何言论和其它行为违反或可能违反上述法律和法规的任何规定，本网站可在任何时候不经任何事先通知终止向该会员提供服务。<br><br>    10、禁止会员从事下列行为:<br>  1) 会员同意将不会利用本网站服务进行任何违法或不正当的活动，包括但不限于下列行为：发布信息或者利用本网站的服务时必须符合中国有关法规，不得在本网站的网页上或者利用本网站的服务制作、复制、发布、传播以下信息：反对宪法所确定的基本原则的；危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；损害国家荣誉和利益的；煽动民族仇恨、民族歧视、破坏民族团结的；破坏国家宗教政策，宣扬邪教和封建迷信的；散布谣言，扰乱社会秩序，破坏社会稳定的；散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；侮辱或者诽谤他人，侵害他人合法权利的；含有虚假、有害、胁迫、侵害他人隐私、骚扰、侵害、中伤、粗俗、猥亵、或其它道德上令人反感的内容；含有中国法律、法规、规章、条例以及任何具有法律效力的规范所限制或禁止的其它内容的。<br>  2) 以任何方式危害未成年人的利益的。<br>  3) 冒充任何人或机构，包含但不限于冒充本网站工作人员、版主、主持人，或以虚伪不实的方式陈述或谎称与任何人或机构有关的。<br>  4) 将病毒或其它计算机代码、档案和程序，加以上载、张贴、发送电子邮件或以其它方式传送的。<br>  5) 跟踪或以其它方式骚扰其他会员的。<br>  6) 以任何方式干扰本网站服务的。<br><br>    11、隐私权<br>  1) 本协议所涉及的隐私是指：<br>  在会员注册本网站帐户时，升级VIP会员时，使用本网站服务和访问本网站网页时，本网站收集的会员的个人身份识别资料，包括会员的昵称、电邮地址、性别、职业等。本网站自动接收并记录会员的浏览器和服务器日志上的信息，包括但不限于会员的IP地址、在线信息、信件等资料。<br>  2) 本网站会收集上述信息将用于：提供网站服务、改进网页内容，满足会员对某种产品、活动的需求、通知您最新产品、活动信息、或根据法律法规要求提交的资料。<br>  3) 会员的帐号具有密码保护功能，以确保会员的隐私和信息安全。在某些情况下，本网站使用通行标准的保密系统，确保资料传送的安全性。<br>  4) 本网站可能利用工具，为合作伙伴的网站进行数据搜集工作，有关数据也会作统计用途。网站会将所记录的会员数据整合起来，以综合数据形式供合作伙伴参考。综合数据会包括人数统计和使用情况等资料，但不会包含任何可以识别个人身份的数据。<br>  5) 本网站不会将会员的个人识别信息出租或出售给任何人，以下情况除外：<br>  会员明确同意让第三方共享资料；<br>  只有透露会员