    17、通知<br>  本网站向其会员发出的通知，将采用电子邮件或页面公告的形式。协议条款的修改或其他事项变更时，本网站将会以上述形式进行通知。<br><br>    18、法律的适用和管辖<br>  本协议的生效、履行、解释及争议的解决均适用中华人民共和国的现行法律，所发生的争议应提交相关仲裁委员会，其仲裁裁决是终局的。本协议因与中华人民共和国现行法律相抵触而导致部分条款无效的，不影响其他条款的效力。<br><br>    19、最终解释权和修改权<br>  本协议的最终解释权和修改权归本网站所有。<br><br>      20、其他条款<br>  1）本用户协议是本网站和会员双方同意后所达成的协议，具有正式的法律效力。<br>   2）本网站保留进一步修改本协议的权利。<br>";};data=a:14:{s:10:"thumbwidth";s:3:"100";s:11:"thumbheight";s:3:"100";s:13:"maxthumbwidth";s:0:"";s:14:"maxthumbheight";s:0:"";s:13:"watermarkfile";s:0:"";s:12:"watermarkpos";s:1:"4";s:6:"ftpssl";s:1:"0";s:7:"ftphost";s:0:"";s:7:"ftpport";s:0:"";s:7:"ftpuser";s:0:"";s:11:"ftppassword";s:0:"";s:7:"ftppasv";s:1:"0";s:6:"ftpdir";s:0:"";s:10:"ftptimeout";s:0:"";};mail=a:9:{s:8:"mailsend";s:1:"2";s:13:"maildelimiter";s:1:"1";s:12:"mailusername";s:1:"1";s:6:"server";s:11:"smtp.qq.com";s:4:"port";s:2:"25";s:4:"auth";s:1:"0";s:4:"from";s:30:"一线牵缘<yanyuwang1234@qq.com>";s:13:"auth_username";s:20:"yanyuwang1234@qq.com";s:13:"auth_password";s:10:"1007794273";};thevaluesubmit=提交;}
